import React, { Component } from 'react';

class  DetailCellRenderer extends Component {
  constructor(props) {
    super(props);
    this.state = {
      firstRecord: props.data.image[0]
    }

  }

  render() {
    return (
      <div style={{padding: 20,display: 'flex',flexDirection: 'row',justifyContent: 'space-between',alignItems: 'center'}}>
        <div>
          <h1>صورة المنتج</h1>
        <h3>{this.state.firstRecord}</h3>
        </div>
        <div>
          <h1>الباركود</h1>
        {/* <h3>{this.props.barcode}</h3> */}
        </div>
        <div>
          <h1>السعر</h1>
        {/* <h3>{this.props.price}</h3> */}
        </div>
      </div>
    );
  }

}

export default DetailCellRenderer;
